montageDefine("daa4856","vendor/requirejs/tests/plugins/double.html",{text:"<!DOCTYPE html><html><head>\n    <title>require.js: Double Plugin Call Test</title>\n    <script src=../doh/runner.js></script>\n    <script src=../doh/_browserRunner.js></script>\n    <script src=../../require.js></script>\n    <script>\n    var master = new doh.Deferred(),\n        count = 0;\n\n    function done() {\n        count += 1;\n        if (count === 2) {\n            master.callback(true);\n        }\n    }\n\n    doh.register(\n        \"doublePluginCall\",\n        [\n            {\n                name: \"doublePluginCall\",\n                timeout: 5000,\n                runTest: function() {\n                    return master;\n                }\n            }\n        ]\n    );\n    doh.run();\n\n    require(['double!foo'], function (foo) {\n        if (foo === 'x') {\n            done();\n        }\n    });\n\n    require(['double!foo'], function (foo) {\n        if (foo === 'x') {\n            done();\n        }\n    });\n\n    </script>\n</head>\n<body>\n    <h1>require.js: Double Plugin Call Test</h1>\n    <p>Check console for messages</p>\n\n\n</body></html>"});